Artist spotlight by @adobestock @adobe ☺️☀️ I appreciate the opportunity to showcase my work and BTS footage. Thank you! I hope that you can get a little bit of an idea of what’s like for me to work on a shoot. During those shoots, I met lots of cool and kind people who are now friends. I’ve gotten to learn from every single person and have enjoyed hearing about each person’s story. Hopefully, my photos will bring little joyful moments to viewers. Beautiful flower arrangements by @byjasonlloyd 💐

